import{_ as e,o as a,c as i,a as r}from"./app.bc63bc0f.js";const m=JSON.parse('{"title":"\u6D4F\u89C8\u5668\u539F\u7406","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668\u4E0E\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668","slug":"\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668\u4E0E\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668"},{"level":3,"title":"\u8FDB\u7A0B\u4E0E\u7EBF\u7A0B","slug":"\u8FDB\u7A0B\u4E0E\u7EBF\u7A0B"},{"level":3,"title":"\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668","slug":"\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668"},{"level":3,"title":"\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668","slug":"\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668"},{"level":3,"title":"\u6700\u65B0\u7684\u591A\u8FDB\u7A0B\u67B6\u6784","slug":"\u6700\u65B0\u7684\u591A\u8FDB\u7A0B\u67B6\u6784"},{"level":3,"title":"\u591A\u8FDB\u7A0B\u67B6\u6784\u5E26\u6765\u7684\u95EE\u9898","slug":"\u591A\u8FDB\u7A0B\u67B6\u6784\u5E26\u6765\u7684\u95EE\u9898"},{"level":3,"title":"\u672A\u6765\u9762\u5411\u670D\u52A1\u7684\u67B6\u6784","slug":"\u672A\u6765\u9762\u5411\u670D\u52A1\u7684\u67B6\u6784"}],"relativePath":"font-end/browser/base.md","lastUpdated":1658330765000}'),d={name:"font-end/browser/base.md"},l=r('<h1 id="\u6D4F\u89C8\u5668\u539F\u7406" tabindex="-1">\u6D4F\u89C8\u5668\u539F\u7406 <a class="header-anchor" href="#\u6D4F\u89C8\u5668\u539F\u7406" aria-hidden="true">#</a></h1><h2 id="\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668\u4E0E\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668" tabindex="-1">\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668\u4E0E\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668 <a class="header-anchor" href="#\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668\u4E0E\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668" aria-hidden="true">#</a></h2><h3 id="\u8FDB\u7A0B\u4E0E\u7EBF\u7A0B" tabindex="-1">\u8FDB\u7A0B\u4E0E\u7EBF\u7A0B <a class="header-anchor" href="#\u8FDB\u7A0B\u4E0E\u7EBF\u7A0B" aria-hidden="true">#</a></h3><p>\u4E00\u4E2A\u8FDB\u7A0B\u5C31\u662F\u4E00\u4E2A\u7A0B\u5E8F\u7684\u8FD0\u884C\u5B9E\u4F8B\u3002\u542F\u52A8\u4E00\u4E2A\u7A0B\u5E8F\u7684\u65F6\u5019\uFF0C\u64CD\u4F5C\u7CFB\u7EDF\u4F1A\u4E3A\u8BE5\u7A0B\u5E8F\u521B\u5EFA\u4E00\u5757\u5185\u5B58\uFF0C\u7528\u6765\u5B58\u653E\u4EE3\u7801\uFF0C\u8FD0\u884C\u4E2D\u7684\u6570\u636E\u548C\u4E00\u4E2A\u6267\u884C\u4EFB\u52A1\u7684\u4E3B\u7EBF\u7A0B\uFF0C\u4E00\u4E2A\u8FD9\u6837\u7684\u8FD0\u884C\u73AF\u5883\u53EB\u8FDB\u7A0B\u3002</p><p>\u7EBF\u7A0B\u662F\u4F9D\u9644\u4E8E\u8FDB\u7A0B\u7684\uFF0C\u800C\u8FDB\u7A0B\u4E2D\u4F7F\u7528\u591A\u7EBF\u7A0B\u5E76\u884C\u5904\u7406\u80FD\u63D0\u5347\u8FD0\u7B97\u6548\u7387\u3002</p><p>\u8FDB\u7A0B\u4E0E\u7EBF\u7A0B\u4E4B\u95F4\u7684\u5173\u7CFB\uFF1A</p><ul><li>\u8FDB\u7A0B\u4E2D\u7684\u4EFB\u610F\u4E00\u7EBF\u7A0B\u6267\u884C\u51FA\u9519\uFF0C\u90FD\u4F1A\u5BFC\u81F4\u6574\u4E2A\u8FDB\u7A0B\u5D29\u6E83</li><li>\u7EBF\u7A0B\u4E4B\u95F4\u5171\u4EAB\u8FDB\u7A0B\u4E2D\u7684\u6570\u636E</li><li>\u5F53\u4E00\u4E2A\u8FDB\u7A0B\u5173\u95ED\u4E4B\u540E\uFF0C\u64CD\u4F5C\u7CFB\u7EDF\u4F1A\u56DE\u6536\u8FDB\u7A0B\u6240\u5360\u7528\u7684\u5185\u5B58</li><li>\u8FDB\u7A0B\u4E4B\u95F4\u7684\u5185\u5BB9\u76F8\u4E92\u9694\u79BB\uFF0C\u5982\u679C\u9700\u8981\u8FDB\u7A0B\u4E2D\u7684\u901A\u4FE1\uFF0C\u5C31\u9700\u8981\u4F7F\u7528\u7528\u4E8E\u8FDB\u7A0B\u95F4\u901A\u4FE1(IPC)\u7684\u673A\u5236\u4E86\u3002</li></ul><h3 id="\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668" tabindex="-1">\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668 <a class="header-anchor" href="#\u5355\u8FDB\u7A0B\u6D4F\u89C8\u5668" aria-hidden="true">#</a></h3><p>\u5355\u8FDB\u7A0B\u6D4F\u89C8 \u5668\u662F\u6307\u6D4F\u89C8\u5668\u7684\u6240\u6709\u529F\u80FD\u6A21\u5757\u90FD\u662F\u8FD0\u884C\u5728\u540C\u4E00\u4E2A\u8FDB\u7A0B\u91CC\uFF0C\u8FD9\u4E9B\u6A21\u5757\u5305\u542B\u4E86\u7F51\u7EDC\u3001\u63D2\u4EF6\u3001 JavaScript \u8FD0\u884C\u73AF\u5883\u3001\u6E32\u67D3\u5F15\u64CE\u548C\u9875\u9762\u7B49\u3002\u5BFC\u81F4\u6D4F\u89C8\u5668<code>\u4E0D\u7A33\u5B9A</code>\u3001<code>\u4E0D\u6D41\u7545</code>\u548C<code>\u4E0D\u5B89\u5168</code>\u3002</p><ul><li><p>\u4E0D\u7A33\u5B9A\uFF1A\u6D4F\u89C8\u5668\u63D2\u4EF6\u5BB9\u6613\u51FA\u95EE\u9898\uFF0C\u51FA\u95EE\u9898\u4EE5\u540E\u4F1A\u5BFC\u81F4\u6574\u4E2A\u8FDB\u7A0B\u7684\u5D29\u6E83\u3002\u6E32\u67D3\u5F15\u64CE\u6A21\u5757\u5728\u5F15\u5165\u4E00\u4E9B\u590D\u6742\u7684JavaScript\u4EE3\u7801\u65F6\u4E5F\u4F1A\u5D29\u6E83\u3002</p></li><li><p>\u4E0D\u6D41\u7545\uFF1A\u7531\u4E8E\u5355\u8FDB\u7A0B\u6A21\u578B\uFF0C\u5728\u540C\u4E00\u65F6\u523B\u4E2D\uFF0C\u53EA\u80FD\u6709\u4E00\u4E2A\u6A21\u5757\u8FD0\u884C\u3002\u5728\u8017\u65F6\u811A\u672C\u4E2D\uFF0C\u5728\u5176\u6267\u884C\u8FC7\u7A0B\u4E2D\uFF0C\u4F1A\u72EC\u5360\u6574\u4E2A\u7EBF\u7A0B\uFF0C\u5BFC\u81F4\u5176\u4ED6\u4EFB\u52A1\u65E0\u6CD5\u6267\u884C\uFF0C\u4F1A\u9020\u6210\u5361\u987F\u7684\u73B0\u8C61\u3002\u9875\u9762\u7684\u5185\u5B58\u6CC4\u6F0F\u4E5F\u662F\u5355\u8FDB\u7A0B\u53D8\u6162\u7684\u4E00\u4E2A\u91CD\u8981\u539F\u56E0\u3002\u8FD0\u884C\u4E00\u4E2A\u590D\u6742\u70B9\u7684\u9875\u9762\u518D\u5173\u95ED\u9875\u9762\uFF0C\u4F1A\u5B58\u5728 \u5185\u5B58\u4E0D\u80FD\u5B8C\u5168\u56DE\u6536\u7684\u60C5\u51B5\uFF0C\u8FD9\u6837\u5BFC\u81F4\u7684\u95EE\u9898\u662F\u4F7F\u7528\u65F6\u95F4\u8D8A\u957F\uFF0C\u5185\u5B58\u5360\u7528\u8D8A\u9AD8\uFF0C\u6D4F\u89C8\u5668\u4F1A\u53D8\u5F97 \u8D8A\u6162\u3002</p></li><li><p>\u4E0D\u5B89\u5168\uFF1A\u901A\u8FC7\u63D2\u4EF6\u53EF\u4EE5\u83B7\u53D6\u5230\u64CD\u4F5C\u7CFB\u7EDF\u7684\u4EFB\u610F\u8D44\u6E90\uFF0C\u6240\u4EE5\u5F53\u8FD0\u884C\u4E00\u4E2A\u63D2\u4EF6\u65F6\uFF0C\u4E5F\u5C31\u610F\u5473\u7740\u8FD9\u4E2A\u63D2\u4EF6\u80FD\u5B8C\u5168\u64CD\u63A7\u64CD\u4F5C\u7CFB\u7EDF\u3002\u5982\u679C\u662F\u6076\u610F\u63D2\u4EF6\uFF0C\u5219\u4F1A\u5F15\u8D77\u5B89\u5168\u95EE\u9898\u3002\u540C\u6837\u7684\uFF0C\u9875\u9762\u7684\u6076\u610F\u811A\u672C\u4E5F\u53EF\u4EE5\u8FDB\u884C\u6B64\u7C7B\u64CD\u4F5C</p></li></ul><h3 id="\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668" tabindex="-1">\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668 <a class="header-anchor" href="#\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668" aria-hidden="true">#</a></h3><p>\u591A\u8FDB\u7A0B\u6D4F\u89C8\u5668\u67B6\u6784\u4E2D\uFF0C\u9875\u9762\u662F\u8FD0\u884C\u5728\u5355\u72EC\u7684\u6E32\u67D3\u8FDB\u7A0B\u4E2D\u7684\uFF0C\u540C\u65F6\u9875\u9762\u4E2D\u7684\u63D2\u4EF6\u4E5F\u8FD0\u884C\u5728\u5355\u72EC\u7684\u63D2\u4EF6\u8FDB\u7A0B\u4E2D\uFF0C\u8FDB\u7A0B\u4E4B\u95F4\u901A\u8FC7<code>ipc(inter-Process Communication)</code>\u673A\u5236\u8FDB\u884C\u901A\u4FE1</p><h4 id="\u5982\u4F55\u89E3\u51B3\u4E0D\u7A33\u5B9A\u7684\u95EE\u9898" tabindex="-1">\u5982\u4F55\u89E3\u51B3\u4E0D\u7A33\u5B9A\u7684\u95EE\u9898 <a class="header-anchor" href="#\u5982\u4F55\u89E3\u51B3\u4E0D\u7A33\u5B9A\u7684\u95EE\u9898" aria-hidden="true">#</a></h4><p>\u7531\u4E8E\u8FDB\u7A0B\u662F\u76F8\u4E92\u9694\u79BB\u7684\uFF0C\u6240\u4EE5\u5F53\u4E00\u4E2A\u9875\u9762\u6216\u8005\u63D2\u4EF6\u5D29\u6E83 \u65F6\uFF0C\u5F71\u54CD\u5230\u7684\u4EC5\u4EC5\u662F\u5F53\u524D\u7684\u9875\u9762\u8FDB\u7A0B\u6216\u8005\u63D2\u4EF6\u8FDB\u7A0B\uFF0C\u5E76\u4E0D\u4F1A\u5F71\u54CD\u5230\u6D4F\u89C8\u5668\u548C\u5176\u4ED6\u9875\u9762\uFF0C\u8FD9\u5C31 \u5B8C\u7F8E\u5730\u89E3\u51B3\u4E86\u9875\u9762\u6216\u8005\u63D2\u4EF6\u7684\u5D29\u6E83\u4F1A\u5BFC\u81F4\u6574\u4E2A\u6D4F\u89C8\u5668\u5D29\u6E83\uFF0C\u4E5F\u5C31\u662F\u4E0D\u7A33\u5B9A\u7684\u95EE\u9898\u3002</p><h4 id="\u5982\u4F55\u89E3\u51B3\u4E0D\u6D41\u7545\u95EE\u9898" tabindex="-1">\u5982\u4F55\u89E3\u51B3\u4E0D\u6D41\u7545\u95EE\u9898 <a class="header-anchor" href="#\u5982\u4F55\u89E3\u51B3\u4E0D\u6D41\u7545\u95EE\u9898" aria-hidden="true">#</a></h4><p>JavaScript \u4E5F\u662F\u8FD0\u884C\u5728\u6E32\u67D3\u8FDB\u7A0B\u4E2D \u7684\uFF0C\u6240\u4EE5\u5373\u4F7F JavaScript \u963B\u585E\u4E86\u6E32\u67D3\u8FDB\u7A0B\uFF0C\u5F71\u54CD\u5230\u7684\u4E5F\u53EA\u662F\u5F53\u524D\u7684\u6E32\u67D3\u9875\u9762\uFF0C\u800C\u5E76\u4E0D\u4F1A\u5F71 \u54CD\u6D4F\u89C8\u5668\u548C\u5176\u4ED6\u9875\u9762\uFF0C\u56E0\u4E3A\u5176\u4ED6\u9875\u9762\u7684\u811A\u672C\u662F\u8FD0\u884C\u5728\u5B83\u4EEC\u81EA\u5DF1\u7684\u6E32\u67D3\u8FDB\u7A0B\u4E2D\u7684</p><p>\u5BF9\u4E8E\u5185\u5B58\u6CC4\u6F0F\u7684\u89E3\u51B3\u65B9\u6CD5\u90A3\u5C31\u66F4\u7B80\u5355\u4E86\uFF0C\u56E0\u4E3A\u5F53\u5173\u95ED\u4E00\u4E2A\u9875\u9762\u65F6\uFF0C\u6574\u4E2A\u6E32\u67D3\u8FDB\u7A0B\u4E5F\u4F1A\u88AB\u5173\u95ED\uFF0C\u4E4B\u540E\u8BE5\u8FDB\u7A0B\u6240\u5360\u7528\u7684\u5185\u5B58\u90FD\u4F1A\u88AB\u7CFB\u7EDF\u56DE\u6536\u3002</p><h4 id="\u5982\u4F55\u89E3\u51B3\u5B89\u5168\u95EE\u9898" tabindex="-1">\u5982\u4F55\u89E3\u51B3\u5B89\u5168\u95EE\u9898 <a class="header-anchor" href="#\u5982\u4F55\u89E3\u51B3\u5B89\u5168\u95EE\u9898" aria-hidden="true">#</a></h4><p>\u91C7\u7528\u591A\u8FDB\u7A0B\u67B6\u6784\u7684\u989D\u5916\u597D\u5904\u662F\u53EF\u4EE5\u4F7F\u7528<code>\u5B89\u5168\u6C99\u7BB1</code>\uFF0C\u4F60\u53EF\u4EE5\u628A\u6C99\u7BB1\u770B\u6210\u662F\u64CD\u4F5C\u7CFB\u7EDF\u7ED9\u8FDB\u7A0B\u4E0A\u4E86\u4E00\u628A\u9501\uFF0C\u6C99\u7BB1\u91CC\u9762\u7684\u7A0B\u5E8F\u53EF\u4EE5\u8FD0\u884C\uFF0C\u4F46\u662F\u4E0D\u80FD\u5728\u4F60\u7684\u786C\u76D8\u4E0A\u5199\u5165\u4EFB\u4F55\u6570\u636E\uFF0C\u4E5F\u4E0D\u80FD\u5728\u654F\u611F\u4F4D\u7F6E\u8BFB\u53D6\u4EFB\u4F55\u6570\u636E\u3002Chrome \u628A\u63D2\u4EF6\u8FDB\u7A0B\u548C\u6E32\u67D3\u8FDB\u7A0B\u9501\u5728\u6C99\u7BB1\u91CC\u9762\uFF0C\u8FD9\u6837\u5373\u4F7F\u5728\u6E32\u67D3\u8FDB\u7A0B\u6216\u8005\u63D2\u4EF6\u8FDB\u7A0B\u91CC \u9762\u6267\u884C\u4E86\u6076\u610F\u7A0B\u5E8F\uFF0C\u6076\u610F\u7A0B\u5E8F\u4E5F\u65E0\u6CD5\u7A81\u7834\u6C99\u7BB1\u53BB\u83B7\u53D6\u7CFB\u7EDF\u6743\u9650\u3002</p><h3 id="\u6700\u65B0\u7684\u591A\u8FDB\u7A0B\u67B6\u6784" tabindex="-1">\u6700\u65B0\u7684\u591A\u8FDB\u7A0B\u67B6\u6784 <a class="header-anchor" href="#\u6700\u65B0\u7684\u591A\u8FDB\u7A0B\u67B6\u6784" aria-hidden="true">#</a></h3><p>\u6700\u65B0\u7684 Chrome \u6D4F\u89C8\u5668\u5305\u62EC:1 \u4E2A\u6D4F\u89C8\u5668(Browser)\u4E3B\u8FDB\u7A0B\u30011 \u4E2A GPU \u8FDB\u7A0B\u30011 \u4E2A\u7F51\u7EDC(NetWork)\u8FDB\u7A0B\u3001\u591A\u4E2A\u6E32\u67D3\u8FDB\u7A0B\u548C\u591A\u4E2A\u63D2\u4EF6\u8FDB\u7A0B\u3002</p><ul><li>\u6D4F\u89C8\u5668\u8FDB\u7A0B: \u4E3B\u8981\u8D1F\u8D23\u754C\u9762\u663E\u793A\u3001\u7528\u6237\u4EA4\u4E92\u3001\u5B50\u8FDB\u7A0B\u7BA1\u7406\uFF0C\u540C\u65F6\u63D0\u4F9B\u5B58\u50A8\u7B49\u529F\u80FD.</li><li>\u6E32\u67D3\u8FDB\u7A0B: \u6838\u5FC3\u4EFB\u52A1\u662F\u5C06 HTML\u3001CSS \u548C JavaScript \u8F6C\u6362\u4E3A\u7528\u6237\u53EF\u4EE5\u4E0E\u4E4B\u4EA4\u4E92\u7684\u7F51\u9875\uFF0C \u6392\u7248\u5F15\u64CE Blink \u548C JavaScript \u5F15\u64CE V8 \u90FD\u662F\u8FD0\u884C\u5728\u8BE5\u8FDB\u7A0B\u4E2D\uFF0C\u9ED8\u8BA4\u60C5\u51B5\u4E0B\uFF0CChrome \u4F1A \u4E3A\u6BCF\u4E2A Tab \u6807\u7B7E\u521B\u5EFA\u4E00\u4E2A\u6E32\u67D3\u8FDB\u7A0B\u3002\u51FA\u4E8E\u5B89\u5168\u8003\u8651\uFF0C\u6E32\u67D3\u8FDB\u7A0B\u90FD\u662F\u8FD0\u884C\u5728\u6C99\u7BB1\u6A21\u5F0F\u4E0B.</li><li>GPU \u8FDB\u7A0B: \u5176\u5B9E\uFF0CChrome \u521A\u5F00\u59CB\u53D1\u5E03\u7684\u65F6\u5019\u662F\u6CA1\u6709 GPU \u8FDB\u7A0B\u7684\u3002\u800C GPU \u7684\u4F7F\u7528\u521D\u8877 \u662F\u4E3A\u4E86\u5B9E\u73B0 3D CSS \u7684\u6548\u679C\uFF0C\u53EA\u662F\u968F\u540E\u7F51\u9875\u3001Chrome \u7684 UI \u754C\u9762\u90FD\u9009\u62E9\u91C7\u7528 GPU \u6765\u7ED8 \u5236\uFF0C\u8FD9\u4F7F\u5F97 GPU \u6210\u4E3A\u6D4F\u89C8\u5668\u666E\u904D\u7684\u9700\u6C42\u3002\u6700\u540E\uFF0CChrome \u5728\u5176\u591A\u8FDB\u7A0B\u67B6\u6784\u4E0A\u4E5F\u5F15\u5165\u4E86 GPU \u8FDB\u7A0B\u3002</li><li>\u7F51\u7EDC\u8FDB\u7A0B: \u4E3B\u8981\u8D1F\u8D23\u9875\u9762\u7684\u7F51\u7EDC\u8D44\u6E90\u52A0\u8F7D\uFF0C\u4E4B\u524D\u662F\u4F5C\u4E3A\u4E00\u4E2A\u6A21\u5757\u8FD0\u884C\u5728\u6D4F\u89C8\u5668\u8FDB\u7A0B\u91CC\u9762 \u7684\uFF0C\u76F4\u81F3\u6700\u8FD1\u624D\u72EC\u7ACB\u51FA\u6765\uFF0C\u6210\u4E3A\u4E00\u4E2A\u5355\u72EC\u7684\u8FDB\u7A0B\u3002</li><li>\u63D2\u4EF6\u8FDB\u7A0B: \u4E3B\u8981\u662F\u8D1F\u8D23\u63D2\u4EF6\u7684\u8FD0\u884C\uFF0C\u56E0\u63D2\u4EF6\u6613\u5D29\u6E83\uFF0C\u6240\u4EE5\u9700\u8981\u901A\u8FC7\u63D2\u4EF6\u8FDB\u7A0B\u6765\u9694\u79BB\uFF0C\u4EE5\u4FDD \u8BC1\u63D2\u4EF6\u8FDB\u7A0B\u5D29\u6E83\u4E0D\u4F1A\u5BF9\u6D4F\u89C8\u5668\u548C\u9875\u9762\u9020\u6210\u5F71\u54CD\u3002</li></ul><p>\u6253\u5F00\u4E00\u4E2Achrome\u9875\u9762\uFF1A\u6700\u5C11\u9700\u8981 1 \u4E2A\u7F51\u7EDC\u8FDB\u7A0B\u30011 \u4E2A\u6D4F\u89C8\u5668\u8FDB\u7A0B\u30011 \u4E2A GPU \u8FDB\u7A0B\u4EE5\u53CA 1 \u4E2A\u6E32\u67D3\u8FDB\u7A0B\uFF0C\u5982\u679C\u6709\u8FD0\u884C\u63D2\u4EF6\u7684\u8BDD\uFF0C\u8FD8\u9700\u8981\u4E00\u4E2A\u63D2\u4EF6\u8FDB\u7A0B\u3002</p><h3 id="\u591A\u8FDB\u7A0B\u67B6\u6784\u5E26\u6765\u7684\u95EE\u9898" tabindex="-1">\u591A\u8FDB\u7A0B\u67B6\u6784\u5E26\u6765\u7684\u95EE\u9898 <a class="header-anchor" href="#\u591A\u8FDB\u7A0B\u67B6\u6784\u5E26\u6765\u7684\u95EE\u9898" aria-hidden="true">#</a></h3><ul><li>\u66F4\u9AD8\u7684\u8D44\u6E90\u5360\u7528\uFF1A \u56E0\u4E3A\u6BCF\u4E2A\u8FDB\u7A0B\u90FD\u4F1A\u5305\u542B\u516C\u5171\u57FA\u7840\u7ED3\u6784\u7684\u526F\u672C(\u5982 JavaScript \u8FD0\u884C\u73AF \u5883)\uFF0C\u8FD9\u5C31\u610F\u5473\u7740\u6D4F\u89C8\u5668\u4F1A\u6D88\u8017\u66F4\u591A\u7684\u5185\u5B58\u8D44\u6E90\u3002</li><li>\u66F4\u590D\u6742\u7684\u4F53\u7CFB\u67B6\u6784\uFF1A \u6D4F\u89C8\u5668\u5404\u6A21\u5757\u4E4B\u95F4\u8026\u5408\u6027\u9AD8\u3001\u6269\u5C55\u6027\u5DEE\u7B49\u95EE\u9898\uFF0C\u4F1A\u5BFC\u81F4\u73B0\u5728\u7684\u67B6\u6784\u5DF2 \u7ECF\u5F88\u96BE\u9002\u5E94\u65B0\u7684\u9700\u6C42\u4E86\u3002</li></ul><h3 id="\u672A\u6765\u9762\u5411\u670D\u52A1\u7684\u67B6\u6784" tabindex="-1">\u672A\u6765\u9762\u5411\u670D\u52A1\u7684\u67B6\u6784 <a class="header-anchor" href="#\u672A\u6765\u9762\u5411\u670D\u52A1\u7684\u67B6\u6784" aria-hidden="true">#</a></h3><p>\u9762\u5411\u670D\u52A1\u7684\u67B6\u6784(Services Oriented Architecture\uFF0C\u7B80\u79F0SOA)\uFF0C\u628A UI\u3001\u6570\u636E\u5E93\u3001\u6587\u4EF6\u3001\u8BBE\u5907\u3001\u7F51\u7EDC\u7B49\u6A21\u5757\u91CD\u6784\u4E3A\u57FA\u7840\u670D\u52A1\uFF0C\u7C7B\u4F3C\u64CD\u4F5C\u7CFB\u7EDF \u5E95\u5C42\u670D\u52A1\u3002\u5982\u679C\u628AChrome\u62BD\u8C61\u4E3A<code>\u4FBF\u643A\u5F0F\u64CD\u4F5C\u7CFB\u7EDF</code>\uFF0CChrome \u57FA\u7840\u670D\u52A1\u4FBF\u53EF\u4EE5\u88AB\u89C6\u4E3A\u8BE5\u64CD\u4F5C\u7CFB\u7EDF\u7684<code>\u57FA\u7840</code>\u7CFB\u7EDF\u670D\u52A1\u5C42\u3002</p><p>\u540C\u65F6<code>Chrome</code>\u8FD8\u63D0\u4F9B\u7075\u6D3B\u7684\u5F39\u6027\u67B6\u6784\uFF0C\u5728\u5F3A\u5927\u6027\u80FD\u8BBE\u5907\u4E0A\u4F1A\u4EE5\u591A\u8FDB\u7A0B\u7684\u65B9\u5F0F\u8FD0\u884C\u57FA\u7840\u670D \u52A1\uFF0C\u4F46\u662F\u5982\u679C\u5728\u8D44\u6E90\u53D7\u9650\u7684\u8BBE\u5907\u4E0A\uFF0CChrome \u4F1A\u5C06\u5F88\u591A\u670D\u52A1\u6574\u5408\u5230\u4E00\u4E2A\u8FDB\u7A0B\u4E2D\uFF0C\u4ECE\u800C\u8282\u7701\u5185\u5B58\u5360\u7528\u3002</p>',28),h=[l];function t(c,o,n,s,p,u){return a(),i("div",null,h)}var f=e(d,[["render",t]]);export{m as __pageData,f as default};
